const Contacts = (props) => {
    return (
        <div className={style.contactsBlock}>
            <h3>Contacts</h3>
            <div>
                <p>GitHub: </p>
                <a href="https://github.com/fliuntyurii"> click </a>
            </div>
        </div>
    )
}

export default Contacts;
